import React from 'react'
import Karavanlar1 from './Components/Karavanlar1';
import Karavanlar2 from './Components/Karavanlar2';
import { karavanlar } from './karavandata';
import Zoom from 'react-reveal/Zoom';
import { Parallax } from 'react-parallax';

function App() {
  return (
    <div className='w-[100%]'>

      <Parallax blur={10} bgImage={karavanlar[0]} bgImageAlt="the cat" strength={200}>
        Content goes here. Parallax height grows with content height.
      </Parallax>

      {karavanlar.map(karavan => {
        return <Karavanlar1 karavanImage={karavan} />
      })}
    </div>
  );
}

export default App;
